    getRequestParams: function (pageNum, pageSize, sortBy, sortExp, search, isPaged, searchcondition) {
      let params = {};
      if (pageNum) {
        params["pageNum"] = pageNum;
      }
      if (searchcondition) {
        params["searchcondition"] = searchcondition;
      }
      if (isPaged) {
        params["isPaged"] = isPaged;
      }
      if (sortBy) {
        params["sortBy"] = sortBy;
      }
      if (sortExp) {
        params["sortExp"] = sortExp;
      }
      if (search) {
        params["search"] = search;
      }
      if (pageSize) {
        params["pageSize"] = pageSize;
      }
      return params;
    },
